import React, { ChangeEvent, useState, useEffect } from "react";

import {
  Button,
  DropDown,
  Input,
  ToggleBtnGroup,
} from "intelli-ui-components-library";
import style from "./server.module.scss";
import { AddIcon, DeleteIcon, EditIcon } from "../../assets/icons";
import { EnumData, ServerData } from "../../utils/constant/types";
import { RowData } from "./Server";
import useArray from "../../utils/hooks/useArray";

function TabList({
  editRowData,
  onClickAddServer,
}: {
  editRowData: RowData;
  onClickAddServer: (obj: any) => void;
}) {
  const [selectedTab, setSelectedTab] = useState("url");

  const [serverData, setServerData] = useState<RowData>({
    id: editRowData.id ?? "",
    selected: editRowData.selected ?? false,
    url: editRowData.url ?? "",
    description: editRowData.description ?? "",
    enums: editRowData.enums ?? [],
  });

  return (
    <div className={style["tabs-container"]}>
      <div className={style["tablist-section"]}>
        <ToggleBtnGroup
          onToggle={(e) => setSelectedTab(e.target.value)}
          selectedTab={selectedTab}
          shouldSelectByDefault={true}
          borderBottom={true}
          disabled
          className={style["toggle-btn"]}
          styleObj={{ bgColor: "#0086ff", color: "#0086ff" }}
        >
          <ToggleBtnGroup.Btn
            value="url"
            className={selectedTab === "url" ? style["active"] : ""}
          >
            URL
          </ToggleBtnGroup.Btn>
          <ToggleBtnGroup.Btn
            value="desc"
            className={selectedTab === "desc" ? style["active"] : ""}
          >
            Description
          </ToggleBtnGroup.Btn>
          <ToggleBtnGroup.Btn
            value="default"
            className={selectedTab === "default" ? style["active"] : ""}
          >
            Default
          </ToggleBtnGroup.Btn>
          <ToggleBtnGroup.Btn
            value="enums"
            className={selectedTab === "enums" ? style["active"] : ""}
          >
            Enums
          </ToggleBtnGroup.Btn>
        </ToggleBtnGroup>

        <div className={style["tab-content"]}>
          {selectedTab === "url" ? (
            <Url
              value={serverData.url}
              handleChange={(val: string) =>
                setServerData({ ...serverData, url: val })
              }
            />
          ) : selectedTab === "desc" ? (
            <Description
              value={serverData.description}
              handleChange={(val: string) =>
                setServerData({ ...serverData, description: val })
              }
            />
          ) : selectedTab === "default" ? (
            <Default
              value={serverData.description}
              handleChange={(val: string) =>
                setServerData({ ...serverData, description: val })
              }
            />
          ) : selectedTab === "enums" ? (
            <Enums
              listOfEnums={serverData.enums}
              handleChange={(arr: EnumData[]) => {
                setServerData({ ...serverData, enums: arr });
              }}
            />
          ) : (
            ""
          )}
        </div>
      </div>

      <Button
        className={style["done-btn"]}
        onClick={() => onClickAddServer(serverData)}
        variant={"contained"}
      >
        Done
      </Button>
    </div>
  );
}

const Url = ({
  value,
  handleChange,
}: {
  value: string;
  handleChange: (val: string) => void;
}) => {
  return (
    <Input
      value={value}
      placeholder={"Enter URL"}
      onChange={(event) => handleChange(event.target.value)}
      className={style["text-input"]}
    />
  );
};
const Description = ({
  value,
  handleChange,
}: {
  value: string;
  handleChange: (val: string) => void;
}) => {
  return (
    <Input
      value={value}
      placeholder={"Enter Description"}
      onChange={(event) => handleChange(event.target.value)}
      className={style["text-input"]}
    />
  );
};

const Default = ({
  value,
  handleChange,
}: {
  value: string;
  handleChange: (val: string) => void;
}) => {
  return (
    <Input
      value={value ? value : "change-me"}
      placeholder={"Enter Default"}
      onChange={(event) => handleChange(event.target.value)}
      className={style["text-input"]}
    />
  );
};

const Enums = ({
  listOfEnums,
  handleChange,
}: {
  listOfEnums: EnumData[];
  handleChange: (val: EnumData[]) => void;
}) => {
  const { array, push, edit, remove } = useArray(listOfEnums);
  useEffect(() => {
    return () => {
      handleChange(array);
    };
  }, []);
  return (
    <div className={style["enums-list"]}>
      <div className={style["add-enum-button-container"]}>
        <Button
          size="md"
          round="round"
          variant="contained"
          className={style["add-btn"]}
          onClick={() => push({ value: "" })}
        >
          <AddIcon fill={"white"} />
          <span style={{ marginLeft: "8px" }}>Add Enum Variable</span>
        </Button>
      </div>

      {array.length > 0 &&
        array.map((obj: EnumData, index: number) => {
          return (
            <div className={style["enum-row"]}>
              <Input
                value={obj.value}
                placeholder={"Enter Enum Value"}
                onChange={(event) => {
                  const { value: newValue } = event.target;
                  let newObj = {
                    ...obj,
                    value: newValue,
                  };
                  edit(index, newObj);
                  handleChange(array);
                }}
                className={style["text-input"]}
              />
              <Button
                size="md"
                round="round"
                variant="outline"
                className={style["buttons"]}
                onClick={() => {
                  remove(index);
                  handleChange(array);
                }}
              >
                <DeleteIcon />
              </Button>
            </div>
          );
        })}
    </div>
  );
};

export default TabList;
